    function openDialog(element) {
        $('#' + element).show("fade");
        centerMe('#' + element);

        $('#containerPage').hide();
        $('#wrapper').hide();
        $('#PageFooter').hide();
    }

    function closeDialog(element) {
        $('#' + element).hide("fade");
        $('#containerPage').show();

        $('#wrapper').show();
        $('#PageFooter').show();
    }
    function centerMe(element) {
        //pass element name to be centered on screen
        var pWidth = $(window).width();
        var pTop = $(window).scrollTop()
        var eWidth = $(element).width()
