    function enableField(params) {
        var array = params.split(',');
        var isExempt = false, isSpecial = false, i, len = array.length;

        for (i = 0; i < len; i++) {
            isExempt = (array[i].toString().indexOf("CA") > -1) && ((array[i].toString().indexOf("Sc4") > -1) || (array[i].toString().indexOf("Sc5") > -1) || (array[i].toString().indexOf("Sc6") > -1));
            isSpecial = (array[i].toString().indexOf("CB") > -1) && ((array[i].toString().indexOf("Sc4") > -1) || (array[i].toString().indexOf("Sc5") > -1) || (array[i].toString().indexOf("Sc6") > -1));
            if (!!isSpecial && (totalSP > 0)) {
                document.getElementById('frm1702MX:' + array[i]).disabled = true;
            }
            else if (!!isExempt && (totalEX > 0)) {
                document.getElementById('frm1702MX:' + array[i]).disabled = true;
            }
            else {
                document.getElementById('frm1702MX:' + array[i]).disabled = false;
            }
        }
    }

